import './Location.css'

function Locations() {

  return (

    <div id="map" >
      <iframe className="frame" src="https://www.google.com.qa/maps/d/u/0/embed?mid=1y8f94yVaPDnNB8Ve8LreG86Bq3qfvBx2" width="640" height="520"></iframe>
    </div>

  )
}

export default Locations
